con:config.script:
def env = testRunner.testCase.testSuite.project.activeEnvironment.name
log.info ("Environment In Use >> " +env)

def CabinNumber1 = context.expand('${Properties_Booking#CabinNumber_1}');
log.info (CabinNumber1);
def CabinNumberUpdated = context.expand('${Properties_Booking#CabinNumber_2_updated}');
log.info (CabinNumberUpdated);

if (CabinNumber1 == CabinNumberUpdated){
	testRunner.testCase.setPropertyValue("CabinUpdateStatus","FAIL");
	testRunner.fail("Cabin Number DID not Update");
} else {
	testRunner.testCase.setPropertyValue("CabinUpdateStatus","PASS");
}

